import '../index.css'
import {AppBar, Toolbar} from "@material-ui/core";

function Header(props){
    const headersData=[
        {
            label: "Home",
            href:"/",
        },
    ];

    const displayDesktop = () =>{
        return <Toolbar>{props.title}</Toolbar>
    }
    return(
        <header>
           <AppBar>{displayDesktop()}</AppBar>
        </header>
    );
}

export default Header;
